import React, { Component } from 'react';
import API from '../utils/api';

class News extends Component {

  api = new API();

  componentDidMount = () => {
    this.api.getNews() 
      .then((data) => {
        console.log(data);
      })
  }

  render() {
    return (
      <div className="main-container">
        NEWS
      </div>
    )
  }
}

export default News;
